if not os.path.isdir(directory):
        raise OSError(f"'{directory}' is not a valid directory")

    total = Counter()
    for root, dirs, files in os.walk(directory):
        for file in files:
            # Only count files with the specified extensions
            if any(file.endswith(ext) for ext in extensions):
                ext = os.path.splitext(file)[1].lower()
                total[ext] += 1

    # Remove files with zero extensions
    if not keep_zero:
        total = total.most_common()
        total = {ext: count for ext, count in total if count}

    return total

try:
